// src/pages/PetDetails.jsx
import React, { useEffect, useState } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

export default function PetDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [pet, setPet] = useState(null);
  const [eventos, setEventos] = useState([]);

  useEffect(() => {
    api.get(`/pets/${id}`)
      .then(res => setPet(res.data))
      .catch(() => alert('Erro ao buscar pet'));

    api.get(`/eventos/pet/${id}`)
      .then(res => setEventos(res.data))
      .catch(() => alert('Erro ao buscar eventos'));
  }, [id]);

  const handleDelete = async () => {
    if (window.confirm('Tem certeza que deseja excluir este pet?')) {
      try {
        await api.delete(`/pets/${id}`);
        navigate('/pets');
      } catch {
        alert('Erro ao excluir pet');
      }
    }
  };

  if (!pet) return <p>Carregando pet...</p>;

  return (
    <div className="container my-4">
      <h3>Detalhes do Pet</h3>

      <div className="d-flex justify-content-between align-items-center mb-3">
        <Link to="/pets" className="btn btn-secondary">← Voltar à Lista</Link>
        <Link to={`/pets/${id}/novo-evento`} className="btn btn-success">Cadastrar Evento</Link>
      </div>

      <div className="mb-4">
        <p><strong>Nome:</strong> {pet.nome}</p>
        <p><strong>Espécie:</strong> {pet.especie}</p>
        <p><strong>Raça:</strong> {pet.raca}</p>
        <p><strong>Porte:</strong> {pet.porte}</p>
        <p><strong>Cor:</strong> {pet.cor}</p>
        <p><strong>Sexo:</strong> {pet.sexo}</p>
        <p><strong>Peso:</strong> {pet.peso} kg</p>
        <p><strong>Castrado:</strong> {pet.castrado ? 'Sim' : 'Não'}</p>
        <p><strong>Carteira de Vacinação em Dia:</strong> {pet.carteiraVacinacaoEmDia ? 'Sim' : 'Não'}</p>
        <p><strong>Data de Cadastro:</strong> {new Date(pet.dataCadastro).toLocaleDateString()}</p>
      </div>

      <div className="d-flex gap-2 mb-4">
        <Link to={`/pets/${id}/editar`} className="btn btn-warning">Editar</Link>
        <button onClick={handleDelete} className="btn btn-danger">Excluir</button>
      </div>

      <h5>Eventos relacionados</h5>
      {eventos.length === 0 ? (
        <p>Nenhum evento encontrado.</p>
      ) : (
        <ul className="list-group">
          {eventos.map(ev => (
            <li key={ev._id} className="list-group-item">
              <strong>{ev.tipo}</strong> - Check-in: {new Date(ev.dataEntrada).toLocaleDateString()} - Check-out: {ev.dataSaida ? new Date(ev.dataSaida).toLocaleDateString() : 'em andamento'}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
